      "full_text" : "幼児を審神者に据えた本丸。\n初期刀が山姥切国広だったため、シールで迎えた山姥切長義に対して「俺の本科だ」という紹介をした結果、審神者が元気に「ほんちぁ！」と呼ぶ事案が発生。",
