      "created_at" : "Tue May 10 01:48:50 +0000 2022",
      "favorited" : false,
      "full_text" : "根兵糖っていつも溜め込んじゃうけど、新刀剣男子にソッコー特付けるのに使うのが一番心理的にスッキリする使い方かも。\n極に使うにしては平準レベリングの調整にしても量が足りなすぎるから、結局使えなかったんだよな。",
