      "in_reply_to_status_id" : "1524634204998307841",
      "created_at" : "Thu May 12 06:20:35 +0000 2022",
      "favorited" : false,
      "full_text" : "そう、だからもう同じ手は二度と使えない。まあそれならそれで構わない。代替案なら幾らでもある。\n問題は、つい昨日まで付いていた長義の神気が今日になって突然消滅したことだ。\n考えられる可能性は少なくない。審神者が気付いた。何らかの攻撃の身代わりになった。前者は反応からして無しだ。",
