      "full_text" : "審神者はぽかんとしている。顔を見れば彼女が何も分かっていない事なんて分かり切ってる。けれど、我慢出来なかった。\n座り込んだままの審神者と目線を合わせようと長義もしゃがむと、審神者がびくりと肩を揺らした。それで、少し加減冷静になった。\n「……最近、何か変わったことは？」",
