      "full_text" : "霊力貯蓄だとか、和服には纏め髪が似合うだとか、骨格的にロングの方が似合うだとか。\n一体何のために色々と理由を付けて、何の為に今日まで彼女のヘアケアを買って出たと思っているのか。\n\n空き部屋を足で開けて審神者を降ろすと後ろ手に鍵を締めた。",
