      "created_at" : "Thu May 12 07:11:52 +0000 2022",
      "favorited" : false,
      "full_text" : "神域に連れて行くでもなし、他の加護を弾くでもない。\nただ強化しただけだ。練って練って練り込んで、彼女の体質と同化したと言える程に浸透させていただけだ。\n「本当に、あなたが大事なだけなんだ」\nさて、次は何をしようか。",
