      "created_at" : "Thu May 12 07:07:10 +0000 2022",
      "favorited" : false,
      "full_text" : "「長義くん、過保護。私の為だって言うなら私の話を聞いてよ」\n「聞いているとも」\nストールを外して肩に掛ける。要らないもんと言わんばかりに頭を振るのを軽く抑える。\n「あなたが大事なんだ。ほら、こんな力だって振り解けない。少し殴っただけで死んでしまうよ」\n「やだ！」\n「困ったな」",
