      "full_text" : "長義「ヒトの…原初の味覚は、塩と脂ということなのかもしれないな」\n国広「海苔は脂とは違う」\n長義「小麦(皮)も違うだろ。だが油と相性が良く引き立つ」\n国広「何だそれは…存外適当なんだな、ヒトの体は」\n長義「旨いと感じる物が多いのは得だろう」\n国広「それは…そう、だな」",
