      "favorited" : false,
      "full_text" : "長義は畑に嫌われている。土に嫌われており、植物にに嫌われており、つまり、山に嫌われていた。\n山の神の正体は多岐に渡る。畏れと信仰は明示的に境界が引かれうる概念ではない。山姥というノードは放射状に入り組んだ分岐の疎結合だ。\n\n長義は立ち止まり汗を拭った。踏み込む度に足が沈む。",
