      "favorited" : false,
      "full_text" : "「そんな理屈があるか。知るか。可愛いなら可愛いとそう言え」\n「言わなくても解るだろう。お前も最早ある意味本科なのだから」\n「可愛いなら！可愛いと！そう！言えッ！！」\n「可愛いに決まっているだろうが一々言わせるな！俯くな鼻をかめ背筋を伸ばせ前を向け！まッッッたく可愛くない！！」",
