      "created_at" : "Fri May 27 14:47:18 +0000 2022",
      "favorited" : false,
      "full_text" : "「写しが可愛くない本科があるものか。誇りでない本科などあるものか」\n「可愛い写しが、誇りの写しが、可愛くない事ばかりする。それは可愛くない！と言ってしまうに、決まっているだろう」\n\n……いや、\n………いやいやいや。",
