      "full_text" : "「……」\nほら黙った。\nもう良いから、放って置いてくれないか。\n往来で憚らずに泣く写しなんてお前にとっては恥なんだろ。\n「…お前にも、写しがあるだろう」\nあの子がどうかしたのか\n「お前にとって、お前の写しはどう見える」\n可愛いに決まっている。俺の誇りだ。\n「それだ」",
