      "favorited" : false,
      "full_text" : "いや…家の中に置いていかれたら流石に…捨てるのもな…一応本科のものだし…みたいな感覚でとりあえず受け取った「きれい」は国広の家の中に入る\n声を掛けたり偶に磨いたりする\n外部から見たらもうそれは完全にお前の物だろって話なんだけど…",
