      "full_text" : "なんというかこれはあれだ　郵便事故\nお前（写し）の所に届けておけば実質届くだろ？みたいな郵送を国広は軒並み受け取り拒否してる訳\nその拒否の固さから本来国広自身に宛てている筈の荷物も届いていない\nでも誤配送先から直接投げつけちゃう訳　家訪ねられた上ではいじゃあこれドン！と置いてかれる",
      "lang" : "ja",
