      "full_text" : "最も、ここで「まあ俺の写しだから当然だけど」みたいな、他を引き合いに出した上での「きれい」はやっぱり受け入れがたいと思う。\nでも、それすらも無くなって、本当にただ国広にお前綺麗だなって長義が言ってしまったら、それはもうどうしようもなくなるんじゃないか？\n\nうわ　怖…",
