      "created_at" : "Fri May 27 14:57:42 +0000 2022",
      "favorited" : false,
      "full_text" : "「お前に合う色はそれよりもう少し黄味が抜けた浅瀬の色で」\n「それは、俺が選んだ色ではない、ので」\n「全くして、お前は、かわいくない」\n\n国広は長義の腕を引いて肩を支えるようにして立ち上がった。ぐうと低い唸り声が上がったが、国広は、その足で、近くの爪紅店へと歩を進めることに決めた。",
