      "full_text" : "一回区切るか\n\nQ. 何故歩く課題を？\nA. フィールドワークが民俗学の本質だからです。しかも、目的を与えません。目的のものが見つかるまで、いえ見つからなくても、海を野を街をだらだら歩く必要があるからです。",
