      "created_at" : "Sun Jun 12 13:36:48 +0000 2022",
      "favorited" : false,
      "full_text" : "は？挙手した学生は不快な表情を隠さなかった。\n「皆には1kmにしようかな。普段の通学の分を入れて構わない。これから万歩計を渡そう」\n本当に配られた。\n「では、第一回の授業を終わろう。諸君、民俗学にようこそ」",
