      "full_text" : "残った学生の反応もはっきりと別れた。ああ\"そういう感じ\"か、と白けた者。逆に身を乗り出すように話を聞き始めた者。\n一人が手を挙げた。\n「今よりも条理が定まっていなかったからではないでしょうか」\n教授は学生に拍手して、そして命じた。\n「君にだけ特別課題だ。次の授業まで毎日2km歩く事」",
      "lang" : "ja",
