      "full_text" : "この辺りでやってらんねえと何人かが席を立つ。教授は何故か嬉しそうにそれを見送り「振替の相談なら乗るよ」とそれに声を掛けた。返事は無かった。\n「彼等を見たか。あれが不条理に対する正常な反応だ。正常で、かつ健常だから出来る反応なんだ。昔むかしは、それが難しかった。何故だと思う」",
