      "full_text" : "これが初日だ。\nあなたが山姥切研究室に入り、研究室の最奥、教授の第二の書斎とも言える小さい小部屋に初めて入る事が許された、あなたの。\nあなたと山姥切教授の研究の、一日目だった。",
