      "created_at" : "Sun Jun 12 13:51:47 +0000 2022",
      "favorited" : false,
      "full_text" : "「そう。情報だ。かいぶつの倒し方。だってそうだろう？\n倒し方が判っているかいぶつなんて怖くない。それはもう、かいぶつじゃない。\nだから俺は蒐集した。かいぶつを。その倒し方を。練り歩いて、話を聞き出して、纏めて、綴じた。そら、これでまた一丁上がりだ。\n俺こそが、山姥切」",
      "lang" : "ja",
      "contributors" : [
        "620422384"
      ],
      "in_reply_to_screen_name" : "deductive_test",
