      "full_text" : "長義「あなたの御名前を確かに頂戴した。これは大変な事だ。だというのに魂が取れない。…いや、俺達のような存在にとって、それは取れるという以前の問題なんだ。取れてしまうんだ。否応無く。これはどうしたことだ」\n審神者「うん簡単なんだよ」",
