      "full_text" : "「これ自体には穢れは無いようだが、もう使わない方がいい。政府には俺から報告しておこう」\n「あ、でも替えのマスクが」\nまたストールで簀巻きにされた。解せぬ。\n「俺の衣が病に打ち負けると？」\n解した。帰ります。おしまい。",
