      "created_at" : "Tue Jul 12 06:01:36 +0000 2022",
      "favorited" : false,
      "full_text" : "「……あれ？」\n店の中は思い出せる。何のことはない普通のドラッグストアだった。他と違うところといえば、少し空調が効きすぎていたくらい。\nでもあの店にどうやって辿り着いた？どこの通りを通った？\n私が何も言えないでいると、長義くんは「勉強代だな」と言った。",
      "lang" : "ja",
      "contributors" : [
        "620422384"
      ],
