      "favorited" : false,
      "full_text" : "人通りの無い何処かで会敵する必要がある。\n「ひいいぃ長義くんそこ右いいい」\nこの辺りの道ならもうとっくに慣れてる。それは長義くんも同じで、私の指示から意図を汲み取って、どんどん人気の無い方へ走り出す。\n「全く今度は何をしたのかな！？」\n「何もしてないぃぃ」",
      "lang" : "ja",
