      "full_text" : "宇宙だった。船の中だったらしい。\n広大な閉鎖空間の中で飽きないように地球と変わらない自然や建物を大量に用意した。地球と交信している衛生アンテナがハックされた。技術者が真っ先に死んだ。人災だった。後手後手、不祥事、揉み消し。つまりいつもの話らしい。",
