      "full_text" : "勿論闇を発生させる過程で肉体も吸収されて死んだ可能性もある。\nたが殿の彼は溶けていた。それは手足の溶けた連中の使い慣れた攻撃手段だった。そうして自分達と同じにするのだ。\nだからつまり、こちらの方が可能性が高いと言える。",
