      "full_text" : "音はどうしたと御堂筋くんが指摘した。臭いはどうだったと。\n確かにそうだ。私達は直前まで談笑していた。ということは背後で起こった事に全く気付いて居なかったことになる。振り返って始めて気が付いたのだ。",
