      "full_text" : "で、御堂筋くん曰く。\n「姿の見えない怪物と殿の男を殺した存在が何故即座にイコールになる？」\n老人は前からあれを知っているようだったし前例があったのではと指摘する。御堂筋くんはニュルンと脱力する。アホかと。根本が見えていないと。",
