      "favorited" : false,
      "full_text" : "関西弁ちゃんと書けないので文語調で。\n私達に起こった事を二人に話すと一期一振はにっこりと老人に歩み寄って何か話し込み始めた。まあキミはそうだよな、うん。\n御堂筋くんは途中からニヤニヤしながら話を最後まで聞いた。まあキミはそうだよな、うん。",
