      "full_text" : "ん？関西弁？\n老人から目を外して見上げると、一期一振と、後ろにだらんと御堂筋翔くんが居た。\nん？マジ？というかなんでこの二人？\n\nそう、お察しの通り夢の話です。おはようございます。",
