      "favorited" : false,
      "full_text" : "ぽこぺん、と間抜けな音が響いた。場違いなほどかわいい音だった。\n外周りをしている部隊の帰還音だった。\nこんな状況で仲間が返ってくるかという警戒はいつもしている。何度かのやり取りの後玄関が素早く開いてまた閉じた。\n皆集まってどうしたのかと外周り組が聞いた。関西弁で。",
