      "created_at" : "Thu Jul 21 13:36:35 +0000 2022",
      "favorited" : false,
      "full_text" : "「まろまろくん大変！ほろよいにスピリタス入れてないのに泥酔した子が出ちゃった！」\n清麿はどこから突っ込めばいいか分からないこの審神者の発言に突っ込むことを辞めた。代わりに、今どこ？と聞いた。相手を確認する必要も無かった。焦りながら、真っ先に自分のところに来た時点で答えは出ていた。",
